    let actionPerformed = false;
    const dummy = student;
    newGrades.map((newGrade) => {
      if (student.id === newGrade.studentId) {
        actionPerformed = true;
        dummy.grade = newGrade.grade;
        result.push(dummy);
      }
      return false;
    });
    if (!actionPerformed) {
      dummy.grade = 'N/A';
      result.push(dummy);
    }
    return false;
  });
